import React from 'react';
// import MenuBar from "./menuBar";
import * as style from "../css/light/phoneListContainer"
import SearchList from "./searchList/searchList"

export default function Main() {

  return (
    <div>
      <div style={style.searchListContainer}>
        <SearchList/>
        <div style={{float:"right", marginTop: "5px", width: "50px", height: "20px", backgroundColor: "blue"}}>
          <div style={{marginRight: "40px", width: "22px", height: "10px", backgroundColor: "green"}}></div>
        </div>
      </div>
    </div>
  )
}
